create table orders
(
    id                  BIGINT(19) auto_increment comment '编号'
        primary key,
    order_id            VARCHAR(50)       null comment '订单id',
    status              BIGINT(19)        null comment '订单状态 参照字典 order_status',
    user_id             BIGINT(19)        null comment '使用用户',
    bike_barcode        VARCHAR(255)      null comment '车辆编号',
    start_time          BIGINT(19)        null comment '开始时间',
    start_lng           VARCHAR(255)      null comment '开始经度',
    start_lat           VARCHAR(255)      null comment '开始纬度',
    end_time            BIGINT(19)        null comment '结束时间',
    end_lng             VARCHAR(255)      null comment '结束经度',
    end_lat             VARCHAR(255)      null comment '结束纬度',
    mile                DOUBLE(20, 5)     null comment '订单里程',
    jurisdiction        BIGINT(19)        null comment '辖区编号',
    close_source        BIGINT(19)        null comment '结束来源 ',
    order_amount        DOUBLE(10, 2)     null comment '订单金额',
    compensation_amount DOUBLE(10, 2)     null comment '补偿金额',
    create_time         BIGINT(19)        null comment '创建时间',
    update_time         BIGINT(19)        null comment '修改时间',
    unlock_mode         INT(10) default 2 null comment '1-无需开锁；2-扫码开锁；'
)
    collate = utf8_bin;

